import React from "react";
import SumObj from "./sumObj";

const HomeContainer = props => {
  return (
    <div className="HomeContainer">
      <SumObj contrats={props.contracts} bills={props.bills} />
      <SumObj bills={props.bills} contrats={props.contracts} />
      <SumObj contrats={props.contracts} bills={props.bills} />
    </div>
  );
};

export default HomeContainer;
